import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/" exact component={Login} />
                <Route path="/auth" component={AuthHandler} />
                <Route path="/onebox" component={Onebox} />
            </Switch>
        </Router>
    );
}
